{
	out->PCSel = o & 3;
	out->ASel = (o & 0xc)>>2;
	out->BSel = (o & 0x30)>>4;
	out->ImmSel = (o & 0x1c0)>>6;
	out->WBSel = (o & 0x600)>>9;
	out->ALUSel = (o & 0x7800)>>11;
	out->RFWen = (o & 0x8000)>>15;
	out->MEMWen = (o & 0x10000)>>16;
	out->CSRWen = (o & 0x20000)>>17;
	out->TrapWen = (o & 0x40000)>>18;
	out->MRET = (o & 0x80000)>>19;
	out->ECall = (o & 0x100000)>>20;
	out->EBreak = (o & 0x200000)>>21;
	out->IllOp = (o & 0x400000)>>22;
}

void configtbCU(struct tbconfig *tbcfg)
{
	tbcfg->source1 = instr;
	tbcfg->source2 = inputs;
	tbcfg->sourcelen = sizeof(instr);
	tbcfg->resultslen = sizeof(outs); //in bytes
}

int genresultsCU()
{
	return N_OUTPUTS;
}

int CompareCU(struct CUOutputs *o1,struct CUOutputs *o2)
{

	if (o1->PCSel!=o2->PCSel)
		goto exitCMP;
	if (o1->ASel!=o2->ASel)
		goto exitCMP;
	if (o1->BSel!=o2->BSel)
		goto exitCMP;
	if (o1->ImmSel!=o2->ImmSel)
		goto exitCMP;
	if (o1->WBSel!=o2->WBSel)
		goto exitCMP;
	if (o1->ALUSel!=o2->ALUSel)
		goto exitCMP;
	if (o1->RFWen!=o2->RFWen)
		goto exitCMP;
	if (o1->MEMWen!=o2->MEMWen)
		goto exitCMP;
	if (o1->CSRWen!=o2->CSRWen)
		goto exitCMP;
	if (o1->TrapWen!=o2->TrapWen)
		goto exitCMP;
	if (o1->MRET!=o2->MRET)
		goto exitCMP;
	if (o1->ECall!=o2->ECall)
		goto exitCMP;
	if (o1->EBreak!=o2->EBreak)
		goto exitCMP;
	if (o1->IllOp!=o2->IllOp)
		goto exitCMP;
	return 0;
exitCMP:
	xil_printf("\t\t\tPCSel:%x,ASel:%x,BSel:%x,ImmSel:%x,WBSel:%x,ALUSel:%x,RFWen:%x,\
			MEMWen:%x,CSRWen:%x,TrapWen:%x,MRET:%x,ECall:%x,EBreak:%x,IllOp:%x\r\n",\
			o1->PCSel,o1->ASel,o1->BSel,o1->ImmSel,o1->WBSel,o1->ALUSel,\
			o1->RFWen,o1->MEMWen,o1->CSRWen,o1->TrapWen,o1->MRET,o1->ECall,\
			o1->EBreak,o1->IllOp);
	xil_printf("\t\t\tPCSel:%x,ASel:%x,BSel:%x,ImmSel:%x,WBSel:%x,ALUSel:%x,RFWen:%x,\
			MEMWen:%x,CSRWen:%x,TrapWen:%x,MRET:%x,ECall:%x,EBreak:%x,IllOp:%x\r\n",\
			o2->PCSel,o2->ASel,o2->BSel,o2->ImmSel,o2->WBSel,o2->ALUSel,\
			o2->RFWen,o2->MEMWen,o2->CSRWen,o2->TrapWen,o2->MRET,o2->ECall,\
			o2->EBreak,o2->IllOp);
	return 1;
}

int MaskAndCompareCU(int HWout, int mask,int expected)
{
	struct CUOutputs a,b;
	mask = (~mask);
	mask = mask & 0xffffffff;
	int output = HWout & mask;
	ParseOutputs(&a,output);
	ParseOutputs(&b,expected);
	return CompareCU(&a,&b);
}

int CheckResultsCU(int *data2check)
{
	int cnt = 0,i;
	struct CUInputs inputs;
	int expected, real, mask;
	for (i = 0; i<N_OUTPUTS-1;i++)
	{
		real = data2check[i+1];
		expected = outs[i];
		mask = masksout[i];
		if(MaskAndCompareCU(real,mask,expected))
		{
			cnt++;
			ParseInputsCu(&inputs,i);
			xil_printf("--- mismatch at %d, expected %x, real %x,Instr:%s, f3:%x, f7:%x, Z:%d, T:%d, CT:%d\r\n",\
					i,expected,real,inputs.inst.opcodestr,inputs.inst.funct3,inputs.inst.funct7,inputs.Z,inputs.Trap,inputs.CondTrue);
		}
	}

	return cnt;
}
